import express from 'express';

const router = express.Router();

router.get('/', (req, res) => {
    res.render('layout', { body: `<%- include("pages/home.ejs") %>` });
});

router.get('/about', (req, res) => {
    res.render('layout', { body: '<%- include("pages/about.ejs") %>' });    
});

router.get('/contact', (req, res) => {
    res.render('layout', { body: '<%- include("pages/contact.ejs") %>' });
});

export default router;

